import React from "react";
import { useHistory } from "react-router-dom";
import {
    Card,
    CardBody,
} from "../../../../../_metronic/_partials/controls";
export default function PaymentAdjustmentHeader() {
    const history = useHistory();
    const handleOverviewChange = () => {
        //history.push("/salescollection/payment-adjustment/overview")
    }
    const handlePaymentVerifyChange = () => {
        history.push("/salescollection/payment-adjustment/payment-verify/all")
    }
    const handlePaymentAdjustmentChange = () => {
        history.push("/salescollection/payment-adjustment/payment-adjustment/invoices-map")
    }
    const handleORDSettlementChange = () => {
        history.push("/salescollection/payment-adjustment/ord-settlement/all-list")
    }
    const handleCreditDebitNoteChange = () => {
        history.push("/salescollection/payment-adjustment/credit-debit-note/all-list")
    }
    const handleProfitabilityAnalysisChange = () =>{
        //history.push("/salescollection/payment-collection/collection-budget")
    }
    return (
        <>
            {/* TODAY SALE ROW */}
            <div className="mt-3">
                <Card>
                    <CardBody style={{ marginBottom: "-36px" }}> 
                        <div>
                            <p className="create-field-title">Today’s Payment Adjustment</p>
                        </div>
                        <div className="mt-5 ml-2 row">
                            <span className="sales-chip mt-5 mr-5"><i class="bi bi-arrow-up-short text-primary"></i>&nbsp;595,428,030&nbsp;<span className='text-muted'>Verify</span></span>
                            <span className="sales-chip mt-5 mr-5"><i class="bi bi-arrow-down-short text-danger"></i>&nbsp;174,428,030&nbsp;<span className='text-muted'>Adjustment</span></span>
                            <span className="sales-chip mt-5 mr-5"><i class="bi bi-arrow-up-short text-primary"></i>&nbsp;99,567,428&nbsp;<span className='text-muted'>ORD Settlement</span></span>
                            <span className="sales-chip mt-5 mr-5"><i class="bi bi-arrow-up-short text-primary"></i>&nbsp;99,567,428&nbsp;<span className='text-muted'>Profit</span></span>
                        </div>
                        <div className="mt-5">
                            <ul class="nav nav-pills mb-3" id="pills-tab" role="tablist">
                                <li class="nav-item" role="presentation">
                                    <a class="nav-link" id="pills-payment-adjustment-overview-tab" data-toggle="pill" href="#pills-payment-adjustment-overview" role="tab" aria-controls="pills-payment-adjustment-overview" aria-selected="false" onClick={handleOverviewChange}>Overview</a>
                                </li>
                                <li class="nav-item" role="presentation">
                                    <a class="nav-link" id="pills-payment-adjustment-payment-verify-tab" data-toggle="pill" href="#pills-payment-adjustment-payment-verify" role="tab" aria-controls="pills-payment-adjustment-payment-verify" aria-selected="false" onClick={handlePaymentVerifyChange}>Payment Verify</a>
                                </li>

                                <li class="nav-item" role="presentation">
                                    <a class="nav-link" id="pills-payment-adjustment-payment-adjustment-tab" data-toggle="pill" href="#pills-payment-adjustment-payment-adjustment" role="tab" aria-controls="pills-payment-adjustment-payment-adjustment" aria-selected="false" onClick={handlePaymentAdjustmentChange}>Payment Adjustment</a>
                                </li>

                                <li class="nav-item" role="presentation">
                                    <a class="nav-link" id="pills-payment-adjustment-ord-settlement-tab" data-toggle="pill" href="#pills-payment-adjustment-ord-settlement" role="tab" aria-controls="pills-payment-adjustment-ord-settlement" aria-selected="false" onClick={handleORDSettlementChange}>ORD Settlement</a>
                                </li>
                                <li class="nav-item" role="presentation">
                                    <a class="nav-link" id="pills-payment-adjustment-credit-debit-note-tab" data-toggle="pill" href="#pills-payment-adjustment-credit-debit-note" role="tab" aria-controls="pills-payment-adjustment-credit-debit-note" aria-selected="false" onClick={handleCreditDebitNoteChange}>Credit/Debit Note</a>
                                </li>
                                <li class="nav-item" role="presentation">
                                    <a class="nav-link" id="pills-payment-adjustment-profitability-analysis-tab" data-toggle="pill" href="#pills-payment-adjustment-profitability-analysis" role="tab" aria-controls="pills-payment-adjustment-profitability-analysis" aria-selected="false" onClick={handleProfitabilityAnalysisChange}>Profitability Analysis</a>
                                </li>
                                <li class="nav-item" role="presentation">
                                    <a class="nav-link" id="pills-payment-adjustment-reports-tab" data-toggle="pill" href="#pills-payment-adjustment-reports" role="tab" aria-controls="pills-payment-adjustment-reports" aria-selected="false">Report</a>
                                </li>
                            </ul>
                        </div>
                    </CardBody>
                </Card>
            </div>
        </>
    );
}
